import React from 'react';
import { Container } from 'bootstrap';
import Header from './components/Header.js';
import Footer from './components/Footer.js';

const App = () => {
  return (
    <div className='App'>
      <Header />
      <Container>
        <h1>Hello world</h1>
      </Container>
      <Footer />
    </div>
  );
};

export default App;
